import React, { Components, Fragment } from 'react';
import ReactDOM from 'react-dom';
import { Header, Footer } from './Layouts'

export default class extends Component {
    render() {
        return <Fragment>
            <Header/>
            <Footer/>
        </Fragment>
    }
}
